#projects{
    .info-section{
        width: 20%;

        .logo{
            border: 10px solid $color1;

            #small-logo{
                display: none;
                margin-bottom: 65px;
            }
        }
    }

    .content-area{
        margin-left: 20%;
        width: 80%;
        background: $color3;
        min-width: 300px;
        height: 100%; 
        overflow: hidden;
    }

    .projects-section{
        margin-bottom: 56px;

        h1{
            font-family: $font3;
            font-weight: 700;
            font-size: 2rem;
            text-transform: uppercase;
            margin-bottom: 56px;
        }

        .work-section{
            display: grid;
            grid-template-columns: 1fr 1fr;

            a{
                text-decoration: none;
                color: black;
            }

            .project-box{
                position: relative;
                padding: 30px;
                transition: all 0.5s ease-in-out;
                -webkit-background-size: cover;
                -moz-background-size: cover;
                -o-background-size: cover;
                background-size: cover;
                height: 400px;
                width: 100%;
                // height: 50%;
                min-width: 240px;


                &:hover{
                    -webkit-box-shadow: 0px 20px 74px 6px rgba(0,0,0,0.12);
                    -moz-box-shadow: 0px 20px 74px 6px rgba(0,0,0,0.12);
                    box-shadow: 0px 20px 74px 6px rgba(0,0,0,0.12);
                }

                .grey-bg{
                    background: $project;
                    position: absolute;
                    top: 0;
                    bottom: 0;
                    right: 0;
                    left: 0;
                    opacity: 0;
                    transition: all 0.3s ease-in-out; 
                    overflow: hidden;
                    &:hover{
                        opacity: 0.9; 
                        .project-info{
                            .project-details{
                                transform: translate3d(10px, 0, 0); 
                                opacity: 1;
                            }
                            .project-title{
                                opacity: 1;
                            }
                            .fa-long-arrow-alt-right{
                                transform: translate3d(10px, 0, 0); 
                                opacity: 1;
                            }
                        }
                    }

                    .project-info{
                        padding: 56px;
                        position: absolute;
                        bottom: 0;
                        width: 100%;

                        .project-details{
                            position: relative;
                            font-size: 1.1rem;
                            text-transform: capitalize;
                            margin: 0 0 1rem;
                            transform: translate3d(-200px, 0, 0); 
                            transition: all .3s ease-in-out;
                            opacity: 0;
                        }
                        .project-title{
                            font-size: 1.8rem;
                            text-transform: uppercase;
                            font-weight: 700;
                            margin-left: 7px;
                            opacity: 0;
                        }
                        .fa-long-arrow-alt-right{
                            position: absolute;
                            bottom: 56px;
                            right: 56px;
                            font-size: 3rem;
                            transform: translate3d(200px, 0, 0); 
                            transition: all .3s ease-in-out;
                            opacity: 0;
                        }
                    }
                }

                .project-about{
                    position: absolute;
                    top: 450px; 
                    right: 43px; 
                    width: 90%; 
                    text-align: center;
                    min-width: 234px;

                    .project-ctn{

                        h2{
                            font-weight: 600;
                            font-size: 1.2rem;
                            font-family: $font3;
                            padding: 5px 0 5px 0; 
                        }

                        p{
                            padding: 5px 0 5px 0; 
                            font-family: $font2;
                        }

                        .github-link{
                            font-size: 2rem;
                            // a{
                            //     color: $color1;
                            // }
                        }
                    }


                }


                h5{
                    font-weight: 600;
                    font-size: 1.3rem;
                    margin-bottom: 1.4rem;
                }

                p{
                    font-weight: 300;
                    font-size: 1rem; 
                    margin-bottom: 1rem;
                }
            }
        }
    }

    footer{
        display: none;
        width: 100%;
        background: $color1; 
        // border: 1px solid black; 
        height: 200px;

        .lists ul{
            list-style-type: none;
            text-align: center;
            margin: 0 auto;
            // border: 1px solid white;
            display: flex; 
            width: 90%;
            padding-top: 20px;


            li{
                width: 100%;
                // border: 1px solid red;
                // width: 300px;
                color: white;
                margin: 0 auto; 

            }
        }

        hr{
            margin-top: 20px;
        }

        .icons{
            font-size: 2.5rem;
            text-align: center;
            letter-spacing: 15px;
            // padding-bottom: 60px;

            a{
                color: white;

                span{
                    display: block;
                }
            }

        }
    }
}

